import { connect, useDispatch } from 'react-redux';
import { withRouter } from 'react-router-dom';

function Step4(props) {

  let dispatch = useDispatch();

  const goForward = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 6, step_number: 4 }
    });
    props.history.push('./sidewalk');
  }

  const goBack = () => {
    dispatch({
      type: 'QUOTE_PROGRESS',
      payload: { divisor: 6, step_number: 2 }
    });
    props.history.push('./location');
  }

  return (
    <div className='quote'>

      <h2>What type of driveway do you have?</h2>

      <input type="radio" id="single_driveway" name="driveway" value="Single Driveway" />
      <label htmlFor="single_driveway">Single Driveway</label>
      <input type="radio" id="double_driveway" name="driveway" value="Double Driveway" />
      <label htmlFor="double_driveway">Double Driveway</label>

      <br></br>
      <button onClick={goBack}>Go to location</button>
      <button onClick={goForward}>Go to sidewalk</button>

    </div>
  );
}

export default connect()(withRouter(Step4));
